import React from "react";
import "./app-header.css"

const AppHeader = ({toDo = 1, done = 2}) => {

    return (
        <div className="header">

            <div className="app-header d-flex">
                <h1>My Todo List</h1>
                
            </div>

        </div>


    )
}

export default AppHeader;
